import { Link } from 'react-router-dom';

const AdmissionsOfficer = () => {
    return ( 
        <div className = 'admissions-officer'>
            <h1>Admissions Officer</h1>

            <div>           
                <Link to = '/DatandArchievesOfficer'><button className = 'previous-button'>Previous</button></Link>
                <Link to = '/SchoolOfficer2'><button className = 'next-button'>Next</button></Link>
            </div>
        </div>
    );
}
 
export default AdmissionsOfficer;
